CREATE DATABASE /*!32312 IF NOT EXISTS*/`gymmanagement` /*!40100 DEFAULT CHARACTER SET utf8mb4 */;

USE `gymmanagement`;

/*Table structure for table `admin_table` */

DROP TABLE IF EXISTS `admin_table`;

CREATE TABLE `admin_table` (
  `aid` int(11) NOT NULL AUTO_INCREMENT,
  `aname` varchar(15) DEFAULT NULL,
  `aemail` varchar(20) DEFAULT NULL,
  `apassword` varchar(20) DEFAULT NULL,
  `ajob` varchar(10) DEFAULT NULL,
  `acity` varchar(20) DEFAULT NULL,
  `address` varchar(20) DEFAULT NULL,
  `aimage` longblob DEFAULT NULL,
  PRIMARY KEY (`aid`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;

/*Data for the table `admin_table` */

insert  into `admin_table`(`aid`,`aname`,`aemail`,`apassword`,`ajob`,`acity`,`address`,`aimage`) values (1,'admin','admin@gmail.com','admin','admin','Yangon','Yangon',NULL);

/*Table structure for table `class` */

DROP TABLE IF EXISTS `class`;

CREATE TABLE `class` (
  `classid` int(11) NOT NULL AUTO_INCREMENT,
  `classname` varchar(50) NOT NULL,
  `classprice` double NOT NULL,
  `classdesc` varchar(10000) DEFAULT NULL,
  `capacity` int(11) NOT NULL,
  `equipments` varchar(70) NOT NULL,
  `equantity` int(11) NOT NULL,
  `cimage` longblob NOT NULL,
  PRIMARY KEY (`classid`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4;

/*Data for the table `class` */

