/*Table structure for table `trainer` */

DROP TABLE IF EXISTS `trainer`;

CREATE TABLE `trainer` (
  `tid` int(11) NOT NULL AUTO_INCREMENT,
  `tname` varchar(50) NOT NULL,
  `temail` varchar(50) NOT NULL,
  `tphone` varchar(30) NOT NULL,
  `tage` int(11) NOT NULL,
  `tweight` varchar(10) NOT NULL,
  `theight` varchar(10) NOT NULL,
  `tgender` varchar(10) NOT NULL,
  `texperience` varchar(100) NOT NULL,
  `tdesc` varchar(100) NOT NULL,
  `status` tinyint(10) DEFAULT NULL,
  `timage` longblob DEFAULT NULL,
  PRIMARY KEY (`tid`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4;

